import React from 'react';

const Navbar = () => {
    return (
        <div id='Navbar'>
            <ul>
                <li><a href="">Home</a></li>
                <li><a href="">About</a></li>
                <li><a href="">Contact</a></li>
                <li><a href="">Career</a></li>
            </ul>
        </div>
    );
}

export default Navbar;
